(1398, 120, '_philosophy_tab_0_tab_title', 'field_5c5155faaf1f2'),
(1399, 120, 'philosophy_tab_0_tab_content', '<strong>We believe:</strong>\r\n<ul>\r\n 	<li>Children are capable and resourceful learners who are active contributors to their own learning</li>\r\n 	<li>Children need to be valued as individuals, within the context of their family and their community.</li>\r\n 	<li>Children can develop confidence and positive self-esteem through a supportive and secure environment</li>\r\n</ul>\r\n<strong>Therefore we:</strong>\r\n<ul>\r\n 	<li>Implement a child-centered program based upon the principles outlined in the National Early Years Learning Framework (EYLF) – ‘Belonging, Being &amp; Becoming’</li>\r\n 	<li>Strive to empower children, by using their thoughts and ideas (interest based) to develop the program Promote each child’s confidence and positive self image through a range of provisions, experiences and opportunities that build upon their understandings, skills, values and sensitivities and promote success</li>\r\n 	<li>Implement an inclusive approach to positively support children’s growth of identity, self-esteem and critical thinking Encourage each child to reach their full potential in accordance with their individual ability</li>\r\n</ul>'),
(1400, 120, '_philosophy_tab_0_tab_content', 'field_5c515614af1f3'),
(1401, 120, 'philosophy_tab', '6'),
(1402, 120, '_philosophy_tab', 'field_5c51559faf1f1'),
(1409, 120, 'philosophy_tab_0_tab_id', 'nav-acae'),
(1410, 120, '_philosophy_tab_0_tab_id', 'field_5c515a425e3be'),
(1419, 120, 'philosophy_tab_1_tab_title', 'Families'),
(1420, 120, '_philosophy_tab_1_tab_title', 'field_5c5155faaf1f2'),
(1421, 120, 'philosophy_tab_1_tab_id', 'nav-families'),
(1422, 120, '_philosophy_tab_1_tab_id', 'field_5c515a425e3be'),
(1423, 120, 'philosophy_tab_1_tab_content', '<strong>We believe:</strong>\r\n<ul>\r\n 	<li>Trust, respect and collaboration form the basis for strong partnerships between families and staff</li>\r\n 	<li>Families, children and staff form a caring community</li>\r\n 	<li>Family involvement is integral to a high quality program</li>\r\n</ul>\r\n<strong>Therefore we:</strong>\r\n<ul>\r\n 	<li>Are committed to open and constructive communication with families which includes discussions, child portfolios, daily diary and newsletters</li>\r\n 	<li>Strive to have empathy and be responsive to family needs, and provide support when required</li>\r\n 	<li>Encourage families to engage in meaningful participation within the program</li>\r\n</ul>'),
