(1472, 120, 'philosophy_tab_2_tab_content', '<strong>We believe:</strong>\r\n<ul>\r\n 	<li>Children learn through collaboration and communication with other children and adults and through interacting with the environment</li>\r\n 	<li>Children need opportunities to practice and consolidate their skills in key learning areas including: language and literacy; creative and expressive arts; mathematics; science and social and emotional development and work towards learning outcomes as expressed in the Early Years Learning Framework (EYLF) – ‘Belonging, Being &amp; Becoming’</li>\r\n 	<li>A rich, stimulating and nurturing environment has the potential to stimulate imagination, promote creativity and enhance aesthetic development</li>\r\n 	<li>Diversity within our centre, families, staff and wider community should be respected and celebrated and that we can play a role in fostering and developing a social conscience among children with a view to addressing social inequities</li>\r\n</ul>\r\n<strong>Therefore we:</strong>\r\n<ul>\r\n 	<li>Implement a flexible program that is responsive to the evolving nature of the early childhood environment and that provides for different learning styles</li>\r\n 	<li>Make observations of children and document their work to form the basis of the program</li>\r\n 	<li>Use both the indoor and outdoor environment to encourage the children’s ability to observe, perceive, explore, investigate, imagine, make choices and problem solve.</li>\r\n 	<li>Provide attractive, well maintained play areas, with the thoughtful use of furnishings and displays</li>\r\n 	<li>Introduce children to a wide range of social and cultural experiences, family types and different ways of doing things so they will learn to value diversity, learn to accept challenges they may face and become fully realised members of society</li>\r\n</ul>'),
(1473, 120, '_philosophy_tab_2_tab_content', 'field_5c515614af1f3'),
(1494, 120, 'philosophy_tab_3_tab_title', 'Educator/Staff'),
(1495, 120, '_philosophy_tab_3_tab_title', 'field_5c5155faaf1f2'),
(1496, 120, 'philosophy_tab_3_tab_id', 'nav-educator'),
(1497, 120, '_philosophy_tab_3_tab_id', 'field_5c515a425e3be'),
(1498, 120, 'philosophy_tab_3_tab_content', '<strong>We believe:</strong>\r\n<ul>\r\n 	<li>In employing educators who are committed to working for the best interests of children and families</li>\r\n 	<li>That each staff member brings fundamental, personal qualities to the centre environment such as empathy, respect, warmth and a passion for learning</li>\r\n 	<li>In the importance of creating an environment of collegiality where personal and professional contributions are valued, communication is open and confidentiality is maintained</li>\r\n</ul>\r\n<strong>Therefore we:</strong>\r\n<ul>\r\n 	<li>Provide opportunities for educator/staff to share in decision making and to obtain feedback</li>\r\n 	<li>Provide a safe and comfortable working environment with release time for programming and other duties</li>\r\n 	<li>Provide ongoing professional development for educator/staff</li>\r\n</ul>'),
(1499, 120, '_philosophy_tab_3_tab_content', 'field_5c515614af1f3'),
(1526, 120, 'philosophy_tab_4_tab_title', 'Community'),
(1527, 120, '_philosophy_tab_4_tab_title', 'field_5c5155faaf1f2'),
(1528, 120, 'philosophy_tab_4_tab_id', 'nav-community'),
(1529, 120, '_philosophy_tab_4_tab_id', 'field_5c515a425e3be'),
(1530, 120, 'philosophy_tab_4_tab_content', '<strong>We believe:</strong>\r\n<ul>\r\n 	<li>We must strive to be a centre of excellence for early childhood education within our community</li>\r\n 	<li>As advocates for our profession, it is important to share our knowledge and experience</li>\r\n 	<li>We are a central link to information and support services within the wider community</li>\r\n 	<li>In the importance of nurturing established relationships with community organizations, and local schools</li>\r\n 	<li>The needs of children, families, staff and the community are constantly changing and that ongoing evaluation is essential to create a service that is responsive to those needs</li>\r\n</ul>\r\n<strong>Therefore we:</strong>\r\n<ul>\r\n 	<li>Ensure that we operate within the guidelines set down by governing and professional bodies</li>\r\n 	<li>Use the established channels of communication with committee and the community</li>\r\n 	<li>Utilise local services in an effective and meaningful way • Participate in community events</li>\r\n 	<li>Evaluate our centre goals and program regularly</li>\r\n 	<li>From this philosophy we have developed many policies, which provide guidelines for the operation of our centre.</li>\r\n 	<li>Policy review and development is ongoing</li>\r\n</ul>'),
(1531, 120, '_philosophy_tab_4_tab_content', 'field_5c515614af1f3'),
(1596, 176, 'philosophy_tab_0_tab_title', 'At ACAE '),
(1597, 176, '_philosophy_tab_0_tab_title', 'field_5c5155faaf1f2'),
(1598, 176, 'philosophy_tab_0_tab_content', '<strong>We believe:</strong>\r\n<ul>\r\n 	<li>Children are capable and resourceful learners who are active contributors to their own learning</li>\r\n 	<li>Children need to be valued as individuals, within the context of their family and their community.</li>\r\n 	<li>Children can develop confidence and positive self-esteem through a supportive and secure environment</li>\r\n</ul>\r\n<strong>Therefore we:</strong>\r\n<ul>\r\n 	<li>Implement a child-centered program based upon the principles outlined in the National Early Years Learning Framework (EYLF) – ‘Belonging, Being &amp; Becoming’</li>\r\n 	<li>Strive to empower children, by using their thoughts and ideas (interest based) to develop the program Promote each child’s confidence and positive self image through a range of provisions, experiences and opportunities that build upon their understandings, skills, values and sensitivities and promote success</li>\r\n 	<li>Implement an inclusive approach to positively support children’s growth of identity, self-esteem and critical thinking Encourage each child to reach their full potential in accordance with their individual ability</li>\r\n</ul>'),
(1599, 176, '_philosophy_tab_0_tab_content', 'field_5c515614af1f3'),
