(1608, 176, 'philosophy_tab_1_tab_content', '<strong>We believe:</strong>\r\n<ul>\r\n 	<li>Trust, respect and collaboration form the basis for strong partnerships between families and staff</li>\r\n 	<li>Families, children and staff form a caring community</li>\r\n 	<li>Family involvement is integral to a high quality program</li>\r\n</ul>\r\n<strong>Therefore we:</strong>\r\n<ul>\r\n 	<li>Are committed to open and constructive communication with families which includes discussions, child portfolios, daily diary and newsletters</li>\r\n 	<li>Strive to have empathy and be responsive to family needs, and provide support when required</li>\r\n 	<li>Encourage families to engage in meaningful participation within the program</li>\r\n</ul>'),
