(1632, 120, 'philosophy_tab_5_tab_content', 'Strong play and interest based learning philosophy build on modern research and practice, incorporated with Australian National Quality Framework and Reggio Emilia approach.\r\nTeaching Programmes guided by the principles outlined in the National Early Years Learning Framework (EYLF) – ‘Belonging, Being &amp; Becoming’.\r\n<ul>\r\n 	<li>Empowerment by using their thoughts and ideas (interest based)</li>\r\n 	<li>Promote confidence and positive self image</li>\r\n 	<li>Positively support growth of identity, self-esteem and critical thinking</li>\r\n 	<li>Encourage to reach their full potential in accordance with their individual ability</li>\r\n</ul>'),
