(2718, 280, '_facilities_box_0_title', 'field_5c5419fcb0fdf'),
(2719, 280, 'facilities_box_0_content', 'Whether it is astronauts or dancers, dinosaurs or princesses; we believe it is of utmost importance to fuel the imagination of kids. Introducing reading to children at a young age paves the way towards correct grammar, spelling, and sentence structure whilst stimulating creativity. This is why we have invested in a calm reading environment, here at ACAE, furnished with an up-to-date range of books imported directly from Australia.\r\n\r\nPaving the way towards correct grammar, spelling, and sentence structure whilst stimulating creativity, with up-to-date range of books imported directly from Australia.'),
(2720, 280, '_facilities_box_0_content', 'field_5c541a18b0fe0'),
(2721, 280, 'facilities_box_1_image', '802'),
