(4256, 489, '_facilities_box_0_title', 'field_5d0201fa96fa4'),
(4257, 489, 'facilities_box_0_content', 'Whether it is astronauts or dancers, dinosaurs or princesses; we believe it is of utmost importance to fuel the imagination of kids. Introducing reading to children at a young age paves the way towards correct grammar, spelling, and sentence structure whilst stimulating creativity. This is why we have invested in a calm reading environment, here at ACAE, furnished with an up-to-date range of books imported directly from Australia.\r\n\r\nPaving the way towards correct grammar, spelling, and sentence structure whilst stimulating creativity, with up-to-date range of books imported directly from Australia.'),
