(4265, 489, 'facilities_box_1_content', 'Here, at ACAE our aim is to make learning as fun and engaging as possible for kids. This is why we equip all our classes with state-of-the-art information and communication technology facilities to familiarise and stimulate children with interactive and online studies.\r\n\r\nAll our classes equipped with state-of-the-art information and communication technology facilities to familiarise and stimulate children with interactive and online studies.'),
