(4274, 489, '_facilities_box_2_title', 'field_5d0201fa96fa4'),
(4275, 489, 'facilities_box_2_content', 'Running! Skipping! Climbing! It is essential for kids to receive wholesome meals to cater for their active lifestyles and growing bodies, which is why we provide morning tea, lunch, and afternoon tea to all our little ones the Preschool. Our nutritious snacks, rich in vitamins and minerals, introduces children to healthy eating habits from early onwards.\r\n\r\nWe provide morning tea, lunch, and afternoon tea rich in vitamins and minerals, introduces children to healthy eating habits from early onwards.'),
