(5999, 815, '_facilities_box_0_title', 'field_5c5419fcb0fdf'),
(6000, 815, 'facilities_box_0_content', 'Whether it is astronauts or dancers, dinosaurs or princesses; we believe it is of utmost importance to fuel the imagination of kids. Introducing reading to children at a young age paves the way towards correct grammar, spelling, and sentence structure whilst stimulating creativity. This is why we have invested in a calm reading environment, here at ACAE, furnished with an up-to-date range of books imported directly from Australia.\r\n\r\nPaving the way towards correct grammar, spelling, and sentence structure whilst stimulating creativity, with up-to-date range of books imported directly from Australia.'),
(6001, 815, '_facilities_box_0_content', 'field_5c541a18b0fe0'),
(6002, 815, 'facilities_box_1_image', '802'),
(6003, 815, '_facilities_box_1_image', 'field_5c54186ab0fdd'),
(6004, 815, 'facilities_box_1_hover_image', '804'),
(6005, 815, '_facilities_box_1_hover_image', 'field_5c5419d4b0fde'),
(6006, 815, 'facilities_box_1_title', 'ICT'),
(6007, 815, '_facilities_box_1_title', 'field_5c5419fcb0fdf'),
(6008, 815, 'facilities_box_1_content', 'Here, at ACAE our aim is to make learning as fun and engaging as possible for kids. This is why we equip all our classes with state-of-the-art information and communication technology facilities to familiarise and stimulate children with interactive and online studies.\r\n\r\nAll our classes equipped with state-of-the-art information and communication technology facilities to familiarise and stimulate children with interactive and online studies.'),
(6009, 815, '_facilities_box_1_content', 'field_5c541a18b0fe0'),
(6010, 815, 'facilities_box', '3'),
