(6739, 1009, '_facilities_box_1_title', 'field_5d0201fa96fa4'),
(6740, 1009, 'facilities_box_1_content', 'Here, at ACAE our aim is to make learning as fun and engaging as possible for kids. This is why we equip all our classes with state-of-the-art information and communication technology facilities to familiarise and stimulate children with interactive and online studies.\r\n\r\nAll our classes equipped with state-of-the-art information and communication technology facilities to familiarise and stimulate children with interactive and online studies.'),
(6741, 1009, '_facilities_box_1_content', 'field_5d0201fa973a4'),
