(120, 1, '2019-01-29 20:42:05', '2019-01-30 03:12:05', 'The early years are a special time in a child’s life, an exciting period of discovery and learning. ACAE preschool has a strong play and interest based learning philosophy and our qualified early childhood educators create programs based on current research and practice. Our philosophy is incorporated with Australian National Quality Framework and Reggio Emilia approach.\r\n\r\nReggio Emilia approach to education is committed to the creation of conditions for learning that will enhance and facilitate children’s construction of “his or her own powers of thinking through the synthesis of all the expressive, communicative and cognitive languages” (Edwards and Forman, 1993).', 'Our Philosophy', '', 'publish', 'closed', 'closed', '', 'our-philosophy', '', '', '2019-01-30 21:33:02', '2019-01-31 04:03:02', '', 0, 'http://acae.dd/?page_id=120', 0, 'page', '', 0),
