(221, 1, '2019-01-31 00:55:42', '2019-01-31 07:25:42', 'We were invited to join the meeting with a delegation of 24 Australian universities and colleges in the second Australian Education Exhibition in Myanmar on Saturday 19 September 2015 at the Sule Shangri-La Hotel, Yangon.', 'Australian Education Exhibition Meeting', '', 'publish', 'closed', 'closed', '', 'australian-education-exhibition-meeting', '', '', '2019-08-22 00:25:16', '2019-08-22 06:55:16', '', 0, 'http://acae.dd/?p=221', 0, 'post', '', 0),
(223, 1, '2019-01-31 01:37:40', '2019-01-31 08:07:40', '<h3><strong>Overview</strong></h3>\n<h5>Our early childhood education programme is based on Australian Early Years Learning Framework with strong emphasis on play-based learning, communication and language (including early literacy and numeracy), and social and emotional development with focus on successful transition to formal schooling.</h5>\nOur key learning outcomes include having a sense of identity; become confident and engaged in all learning activities through effective communication.\n<h3><strong>Preschool: Early Childhood Education Programme</strong></h3>\n<ul>\n 	<li>Caring for children of 2 to 5 years old in our child friendly &amp; safe environment from 9 am from 3 pm, Monday to Friday, including morning tea, lunch and afternoon tea.</li>\n 	<li>Indoor and outdoor learning environment providing attractive, well maintained play areas.</li>\n 	<li>Inspiring the children to observe, perceive, explore, investigate, imagine, make choices and problem solve as part of the daily program.</li>\n 	<li>Social and emotional development with focus on successful transition to formal schooling.</li>\n</ul>', 'Preschool', '', 'publish', 'closed', 'closed', '', 'preschool', '', '', '2019-08-22 00:38:32', '2019-08-22 07:08:32', '', 0, 'http://acae.dd/?page_id=223', 0, 'page', '', 0),
(225, 1, '2019-01-31 01:39:40', '2019-01-31 08:09:40', '<h3>Overview</h3>\nOur Primary coaching programs are designed to bridge the academic and knowledge gap between children from Government and Non Government schools, and guided by learning objectives of NSW Syllabus Focuses on English languageproficiency, general ability, reasoning and problem solving skills.\n\nFace to face teaching and online programs, are specially designed to achieve the learning objectives, which include verbal and written communication skills, creative writing skills, having a solid foundation in English language; and developed skills in general ability, reasoning and problem solving.\n<h3>Primary Coaching Programmes</h3>\nDesigned to bridge the academic and knowledge gap between children from Government and Non Government schools.\n\nFace to face teaching and online programs, guided by learning objectives of NSW Syllabus with focus on:\n<ul>\n 	<li>English language proficiency</li>\n 	<li>Verbal and written communication skills</li>\n 	<li>General ability</li>\n 	<li>Creative writing skills</li>\n 	<li>Reasoning and problem solving skills</li>\n</ul>', 'Primary', '', 'publish', 'closed', 'closed', '', 'primary', '', '', '2019-08-22 00:39:38', '2019-08-22 07:09:38', '', 0, 'http://acae.dd/?page_id=225', 0, 'page', '', 0),
(226, 1, '2019-01-31 01:39:40', '2019-01-31 08:09:40', '', 'Primary', '', 'inherit', 'closed', 'closed', '', '225-revision-v1', '', '', '2019-01-31 01:39:40', '2019-01-31 08:09:40', '', 225, 'http://acae.dd/225-revision-v1/', 0, 'revision', '', 0),
(227, 1, '2019-01-31 01:39:54', '2019-01-31 08:09:54', '<h3>Overview</h3>\nOur special needs classes are designed to educating children with learning disabilities, communication disorders, emotional and behavioural disorders, physical and developmental disabilities. We focus on each child’s individual needs and differences and give them the opportunity to further develop their independence, integration, academic achievement, emotional well being, higher level of success with learning and improved communication.\n\nAt ACAE, we guarantee personalised attention to all students in need of any extra support from a certified member of our teaching staff.\n<h3>Special Needs Classes</h3>\nDesigned to educating children with:\n<ul>\n 	<li>Learning disabilities</li>\n 	<li>Communication disorders</li>\n 	<li>Emotional and behavioural disorders</li>\n 	<li>Physical and developmental disabilities</li>\n</ul>\nPersonalised attention and extra support, focusing on each child’s individual needs and differences, and give them the opportunity to further develop their:\n<ul>\n 	<li>Independence</li>\n 	<li>Integration</li>\n 	<li>Academic achievement</li>\n 	<li>Emotional well being</li>\n 	<li>Higher level of success with learning</li>\n 	<li>Improved communication</li>\n</ul>', 'Special Needs Classes', '', 'publish', 'closed', 'closed', '', 'special-needs-classes', '', '', '2019-08-22 00:40:08', '2019-08-22 07:10:08', '', 0, 'http://acae.dd/?page_id=227', 0, 'page', '', 0),
