(429, 1, '2019-02-08 00:12:27', '2019-02-08 06:42:27', '<h3>Founders’ Welcome</h3>\r\n<h5>Warm welcome to our tight-knit community. Here at ACAE, we understand that as self-esteem is critical as the children develop into young individuals. This is why we prioritise a nurturing environment with personalised attention from qualified member of teaching staff to encourage every child’s blossoming confidence and independence.</h5>\r\nWe believe that learning should be a fun and engaging experience for children, so at ACAE we emphasise the importance of developing a wide scope of skills through an interactive-play program. Our enrichment courses introduce children to a range of innovative activities to stimulate their curiosity and imagination.\r\nFrom group-work activities to interactive tablets to special needs classes, we are able to accommodate to the different learning styles of each child through various teaching methods.\r\n\r\nAll this is carried out in a welcoming environment helping young learners grow into confident individuals', 'Founders', '', 'inherit', 'closed', 'closed', '', '117-revision-v1', '', '', '2019-02-08 00:12:27', '2019-02-08 06:42:27', '', 117, 'http://acae.dd/117-revision-v1/', 0, 'revision', '', 0),
