(567, 1, '2019-01-30 04:08:54', '2019-01-30 10:38:54', 'We are looking for dynamic, enthusiastic, individuals to join our friendly team. If interested, please call us for a chat, or send us your resume for one of the positions below!\n<ul>\n 	<li>Foreign Educators</li>\n 	<li>Local Educators</li>\n 	<li>Teaching Assistant</li>\n 	<li>Casual Staff</li>\n 	<li>Customer Service Staff</li>\n</ul>', 'အလုပ်အကိုင် အခွင့်အလမ်းများ', '', 'publish', 'closed', 'closed', '', 'career-opportunities', '', '', '2019-06-14 04:27:54', '2019-06-14 10:57:54', '', 0, 'http://acae.dd/career-opportunities/', 0, 'page', '', 0),
(568, 1, '2019-06-14 04:27:53', '2019-06-14 10:57:53', 'We are looking for dynamic, enthusiastic, individuals to join our friendly team. If interested, please call us for a chat, or send us your resume for one of the positions below!\n<ul>\n 	<li>Foreign Educators</li>\n 	<li>Local Educators</li>\n 	<li>Teaching Assistant</li>\n 	<li>Casual Staff</li>\n 	<li>Customer Service Staff</li>\n</ul>', 'အလုပ်အကိုင် အခွင့်အလမ်းများ', '', 'inherit', 'closed', 'closed', '', '567-revision-v1', '', '', '2019-06-14 04:27:53', '2019-06-14 10:57:53', '', 567, 'http://acae.dd/567-revision-v1/', 0, 'revision', '', 0),
(570, 1, '2019-01-29 20:40:21', '2019-01-30 03:10:21', '<h3>Founders’ Welcome</h3>\n<h5>Warm welcome to our tight-knit community. Here at ACAE, we understand that as self-esteem is critical as the children develop into young individuals. This is why we prioritise a nurturing environment with personalised attention from qualified member of teaching staff to encourage every child’s blossoming confidence and independence.</h5>\nWe believe that learning should be a fun and engaging experience for children, so at ACAE we emphasise the importance of developing a wide scope of skills through an interactive-play program. Our enrichment courses introduce children to a range of innovative activities to stimulate their curiosity and imagination.\nFrom group-work activities to interactive tablets to special needs classes, we are able to accommodate to the different learning styles of each child through various teaching methods.\n\nAll this is carried out in a welcoming environment helping young learners grow into confident individuals', 'တည်ထောင်သူများ', '', 'publish', 'closed', 'closed', '', 'founders', '', '', '2019-06-14 04:28:37', '2019-06-14 10:58:37', '', 0, 'http://acae.dd/founders/', 0, 'page', '', 0),
(571, 1, '2019-06-14 04:28:36', '2019-06-14 10:58:36', '<h3>Founders’ Welcome</h3>\n<h5>Warm welcome to our tight-knit community. Here at ACAE, we understand that as self-esteem is critical as the children develop into young individuals. This is why we prioritise a nurturing environment with personalised attention from qualified member of teaching staff to encourage every child’s blossoming confidence and independence.</h5>\nWe believe that learning should be a fun and engaging experience for children, so at ACAE we emphasise the importance of developing a wide scope of skills through an interactive-play program. Our enrichment courses introduce children to a range of innovative activities to stimulate their curiosity and imagination.\nFrom group-work activities to interactive tablets to special needs classes, we are able to accommodate to the different learning styles of each child through various teaching methods.\n\nAll this is carried out in a welcoming environment helping young learners grow into confident individuals', 'တည်ထောင်သူများ', '', 'inherit', 'closed', 'closed', '', '570-revision-v1', '', '', '2019-06-14 04:28:36', '2019-06-14 10:58:36', '', 570, 'http://acae.dd/570-revision-v1/', 0, 'revision', '', 0),
