(576, 1, '2019-01-31 01:40:11', '2019-01-31 08:10:11', '<h3>Overview</h3>\nACAE is planning to become Australian International school in Myanmar. Our First Kindergarten class commenced in 2018 Term 1 and New South Wales Curriculum is used. ACAE will continue to open a new class every year going forwar and moving in to a new purpose built campus in 2019.\n\nAim to develop students into independent and successful learners , confident and creative individuals and active and informed citizens- with the view to giving them all the skills , knowledge and capabilities to thrive in a globalized world.\n\n<strong>Purpose</strong>\n<ul>\n 	<li>Creating a happy, supportive and safe environment</li>\n 	<li>Providing a wide range of high quality educational and social experiences</li>\n 	<li>Fostering high academic achievement</li>\n 	<li>Caring for each other</li>\n 	<li>Encouraging appreciation of diversity</li>\n 	<li>Using a collaborative and co- operative approach</li>\n 	<li>Encouraging students to do their best at all times</li>\n</ul>\n<strong>Enrollment</strong>\n\nIf your child turns five on or before 31 July, they can enroll for Kindergarten in Australian Centre for Academic Enrichment.\n\n<strong>Curriculum</strong>\n\nOur school provides high quality , student centered teaching in the six key learning Areas ( KLAs) of the NSW curriculum:\n<ul>\n 	<li>Myanmar</li>\n 	<li>English</li>\n 	<li>Mathematics</li>\n 	<li>Science &amp; Technology</li>\n 	<li>Creative Arts</li>\n 	<li>Human Society and its Environment</li>\n 	<li>Personal Development Health and Physical Exercise</li>\n 	<li>Elective Language</li>\n 	<li>Sports</li>\n</ul>', 'သူငယ်တန်း', '', 'publish', 'closed', 'closed', '', 'kindergarden-class', '', '', '2019-06-14 04:29:52', '2019-06-14 10:59:52', '', 0, 'http://acae.dd/kindergarden-class/', 0, 'page', '', 0),
(577, 1, '2019-06-14 04:29:52', '2019-06-14 10:59:52', '<h3>Overview</h3>\nACAE is planning to become Australian International school in Myanmar. Our First Kindergarten class commenced in 2018 Term 1 and New South Wales Curriculum is used. ACAE will continue to open a new class every year going forwar and moving in to a new purpose built campus in 2019.\n\nAim to develop students into independent and successful learners , confident and creative individuals and active and informed citizens- with the view to giving them all the skills , knowledge and capabilities to thrive in a globalized world.\n\n<strong>Purpose</strong>\n<ul>\n 	<li>Creating a happy, supportive and safe environment</li>\n 	<li>Providing a wide range of high quality educational and social experiences</li>\n 	<li>Fostering high academic achievement</li>\n 	<li>Caring for each other</li>\n 	<li>Encouraging appreciation of diversity</li>\n 	<li>Using a collaborative and co- operative approach</li>\n 	<li>Encouraging students to do their best at all times</li>\n</ul>\n<strong>Enrollment</strong>\n\nIf your child turns five on or before 31 July, they can enroll for Kindergarten in Australian Centre for Academic Enrichment.\n\n<strong>Curriculum</strong>\n\nOur school provides high quality , student centered teaching in the six key learning Areas ( KLAs) of the NSW curriculum:\n<ul>\n 	<li>Myanmar</li>\n 	<li>English</li>\n 	<li>Mathematics</li>\n 	<li>Science &amp; Technology</li>\n 	<li>Creative Arts</li>\n 	<li>Human Society and its Environment</li>\n 	<li>Personal Development Health and Physical Exercise</li>\n 	<li>Elective Language</li>\n 	<li>Sports</li>\n</ul>', 'သူငယ်တန်း', '', 'inherit', 'closed', 'closed', '', '576-revision-v1', '', '', '2019-06-14 04:29:52', '2019-06-14 10:59:52', '', 576, 'http://acae.dd/576-revision-v1/', 0, 'revision', '', 0),
(579, 1, '2019-01-29 20:42:05', '2019-01-30 03:12:05', 'The early years are a special time in a child’s life, an exciting period of discovery and learning. ACAE preschool has a strong play and interest based learning philosophy and our qualified early childhood educators create programs based on current research and practice. Our philosophy is incorporated with Australian National Quality Framework and Reggio Emilia approach.\n\nReggio Emilia approach to education is committed to the creation of conditions for learning that will enhance and facilitate children’s construction of “his or her own powers of thinking through the synthesis of all the expressive, communicative and cognitive languages” (Edwards and Forman, 1993).', 'Our Philosophy', '', 'publish', 'closed', 'closed', '', 'our-philosophy', '', '', '2019-06-14 04:30:27', '2019-06-14 11:00:27', '', 0, 'http://acae.dd/our-philosophy/', 0, 'page', '', 0),
(580, 1, '2019-06-14 04:30:27', '2019-06-14 11:00:27', 'The early years are a special time in a child’s life, an exciting period of discovery and learning. ACAE preschool has a strong play and interest based learning philosophy and our qualified early childhood educators create programs based on current research and practice. Our philosophy is incorporated with Australian National Quality Framework and Reggio Emilia approach.\n\nReggio Emilia approach to education is committed to the creation of conditions for learning that will enhance and facilitate children’s construction of “his or her own powers of thinking through the synthesis of all the expressive, communicative and cognitive languages” (Edwards and Forman, 1993).', 'Our Philosophy', '', 'inherit', 'closed', 'closed', '', '579-revision-v1', '', '', '2019-06-14 04:30:27', '2019-06-14 11:00:27', '', 579, 'http://acae.dd/579-revision-v1/', 0, 'revision', '', 0),
(582, 1, '2019-01-31 01:37:40', '2019-01-31 08:07:40', '<h3><strong>Overview</strong></h3>\n<h5>Our early childhood education programme is based on Australian Early Years Learning Framework with strong emphasis on play-based learning, communication and language (including early literacy and numeracy), and social and emotional development with focus on successful transition to formal schooling.</h5>\nOur key learning outcomes include having a sense of identity; become confident and engaged in all learning activities through effective communication.\n<h3><strong>Preschool: Early Childhood Education Programme</strong></h3>\n<ul>\n 	<li>Caring for children of 2 to 5 years old in our child friendly &amp; safe environment from 9 am from 3 pm, Monday to Friday, including morning tea, lunch and afternoon tea.</li>\n 	<li>Indoor and outdoor learning environment providing attractive, well maintained play areas.</li>\n 	<li>Inspiring the children to observe, perceive, explore, investigate, imagine, make choices and problem solve as part of the daily program.</li>\n 	<li>Social and emotional development with focus on successful transition to formal schooling.</li>\n</ul>', 'မူလတန်းကြို', '', 'publish', 'closed', 'closed', '', 'preschool', '', '', '2019-06-14 04:31:07', '2019-06-14 11:01:07', '', 0, 'http://acae.dd/preschool/', 0, 'page', '', 0),
(583, 1, '2019-06-14 04:31:07', '2019-06-14 11:01:07', '<h3><strong>Overview</strong></h3>\n<h5>Our early childhood education programme is based on Australian Early Years Learning Framework with strong emphasis on play-based learning, communication and language (including early literacy and numeracy), and social and emotional development with focus on successful transition to formal schooling.</h5>\nOur key learning outcomes include having a sense of identity; become confident and engaged in all learning activities through effective communication.\n<h3><strong>Preschool: Early Childhood Education Programme</strong></h3>\n<ul>\n 	<li>Caring for children of 2 to 5 years old in our child friendly &amp; safe environment from 9 am from 3 pm, Monday to Friday, including morning tea, lunch and afternoon tea.</li>\n 	<li>Indoor and outdoor learning environment providing attractive, well maintained play areas.</li>\n 	<li>Inspiring the children to observe, perceive, explore, investigate, imagine, make choices and problem solve as part of the daily program.</li>\n 	<li>Social and emotional development with focus on successful transition to formal schooling.</li>\n</ul>', 'မူလတန်းကြို', '', 'inherit', 'closed', 'closed', '', '582-revision-v1', '', '', '2019-06-14 04:31:07', '2019-06-14 11:01:07', '', 582, 'http://acae.dd/582-revision-v1/', 0, 'revision', '', 0),
(585, 1, '2019-01-31 01:39:40', '2019-01-31 08:09:40', '<h3>Overview</h3>\nOur Primary coaching programs are designed to bridge the academic and knowledge gap between children from Government and Non Government schools, and guided by learning objectives of NSW Syllabus Focuses on English languageproficiency, general ability, reasoning and problem solving skills.\n\nFace to face teaching and online programs, are specially designed to achieve the learning objectives, which include verbal and written communication skills, creative writing skills, having a solid foundation in English language; and developed skills in general ability, reasoning and problem solving.\n<h3>Primary Coaching Programmes</h3>\nDesigned to bridge the academic and knowledge gap between children from Government and Non Government schools.\n\nFace to face teaching and online programs, guided by learning objectives of NSW Syllabus with focus on:\n<ul>\n 	<li>English language proficiency</li>\n 	<li>Verbal and written communication skills</li>\n 	<li>General ability</li>\n 	<li>Creative writing skills</li>\n 	<li>Reasoning and problem solving skills</li>\n</ul>', 'မူလတန်း', '', 'publish', 'closed', 'closed', '', 'primary', '', '', '2019-06-14 04:31:45', '2019-06-14 11:01:45', '', 0, 'http://acae.dd/primary/', 0, 'page', '', 0),
(586, 1, '2019-06-14 04:31:44', '2019-06-14 11:01:44', '<h3>Overview</h3>\nOur Primary coaching programs are designed to bridge the academic and knowledge gap between children from Government and Non Government schools, and guided by learning objectives of NSW Syllabus Focuses on English languageproficiency, general ability, reasoning and problem solving skills.\n\nFace to face teaching and online programs, are specially designed to achieve the learning objectives, which include verbal and written communication skills, creative writing skills, having a solid foundation in English language; and developed skills in general ability, reasoning and problem solving.\n<h3>Primary Coaching Programmes</h3>\nDesigned to bridge the academic and knowledge gap between children from Government and Non Government schools.\n\nFace to face teaching and online programs, guided by learning objectives of NSW Syllabus with focus on:\n<ul>\n 	<li>English language proficiency</li>\n 	<li>Verbal and written communication skills</li>\n 	<li>General ability</li>\n 	<li>Creative writing skills</li>\n 	<li>Reasoning and problem solving skills</li>\n</ul>', 'မူလတန်း', '', 'inherit', 'closed', 'closed', '', '585-revision-v1', '', '', '2019-06-14 04:31:44', '2019-06-14 11:01:44', '', 585, 'http://acae.dd/585-revision-v1/', 0, 'revision', '', 0);
