(1040, 1, '2019-12-14 00:29:58', '2019-12-14 06:59:58', '<p>ကျနော်တို့ Froggies နဲ့သူငယ်ချင်းအသစ်ကိုမိတ်ဆက်ပေးချင်ပါတယ်။ Allegra ကိုကြိုဆိုပါတယ်။ Allegra သည်သြစတြေးလျတွင်နေထိုင်ပြီး ACAE ရှိကျွန်ုပ်တို့၏ဒါရိုက်တာတစ် ဦး ၏သမီးဖြစ်သည်။ Allegra သည်လာမည့်နှစ်ပတ်တွင်ကျွန်ုပ်တို့ကိုလာရောက်ပူးပေါင်းမည်။ Allegra သည်သူမ၏ပတ် ၀ န်းကျင်အသစ်နှင့်ကောင်းစွာနေခဲ့သည်။ သူမသည်မီးဖိုချောင်ထောင့်တွင်ကစားရန်အထူးသဖြင့်နှစ်သက်သည်။ Allegra သည်သူမ၏အတန်းဖော်အသစ်များနှင့်မိတ်ဆက်ရန်ရှက်ရွံ့ခြင်းမရှိဘဲသူတို့နှင့်အတူကစားခြင်း၊ ကျွန်ုပ်တို့နှင့် Allegra ကစားခြင်းနှင့်သင်ယူခြင်းအတွက်ကျေးဇူးတင်ပါသည်။ နောက်လာမည့်ရက်သတ္တပတ်အနည်းငယ်အတွင်းသင့်အားပိုမိုသိကျွမ်းလာရန်မျှော်လင့်ပါသည်။</p>', 'Allegra နှင့်မိတ်ဆက်ပေးခြင်း', '', 'publish', 'closed', 'closed', '', 'allegra-%e1%80%94%e1%80%be%e1%80%84%e1%80%b7%e1%80%ba%e1%80%99%e1%80%ad%e1%80%90%e1%80%ba%e1%80%86%e1%80%80%e1%80%ba%e1%80%95%e1%80%b1%e1%80%b8%e1%80%81%e1%80%bc%e1%80%84%e1%80%ba%e1%80%b8', '', '', '2019-12-14 00:41:25', '2019-12-14 07:11:25', '', 0, 'http://acae.dd/?p=1040', 0, 'post', '', 0),
(1041, 1, '2019-12-14 00:29:58', '2019-12-14 06:59:58', '<!-- wp:preformatted -->\n<pre class=\"wp-block-preformatted\">ကျနော်တို့ Froggies နဲ့သူငယ်ချင်းအသစ်ကိုမိတ်ဆက်ပေးချင်ပါတယ်။ Allegra ကိုကြိုဆိုပါတယ်။ Allegra သည်သြစတြေးလျတွင်နေထိုင်ပြီး ACAE ရှိကျွန်ုပ်တို့၏ဒါရိုက်တာတစ် ဦး ၏သမီးဖြစ်သည်။ Allegra သည်လာမည့်နှစ်ပတ်တွင်ကျွန်ုပ်တို့ကိုလာရောက်ပူးပေါင်းမည်။ Allegra သည်သူမ၏ပတ် ၀ န်းကျင်အသစ်နှင့်ကောင်းစွာနေခဲ့သည်။ သူမသည်မီးဖိုချောင်ထောင့်တွင်ကစားရန်အထူးသဖြင့်နှစ်သက်သည်။ Allegra သည်သူမ၏အတန်းဖော်အသစ်များနှင့်မိတ်ဆက်ရန်ရှက်ရွံ့ခြင်းမရှိဘဲသူတို့နှင့်အတူကစားခြင်း၊ ကျွန်ုပ်တို့နှင့် Allegra ကစားခြင်းနှင့်သင်ယူခြင်းအတွက်ကျေးဇူးတင်ပါသည်။ နောက်လာမည့်ရက်သတ္တပတ်အနည်းငယ်အတွင်းသင့်အားပိုမိုသိကျွမ်းလာရန်မျှော်လင့်ပါသည်။</pre>\n<!-- /wp:preformatted -->', 'Allegra နှင့်မိတ်ဆက်ပေးခြင်း', '', 'inherit', 'closed', 'closed', '', '1040-revision-v1', '', '', '2019-12-14 00:29:58', '2019-12-14 06:59:58', '', 1040, 'http://acae.dd/1040-revision-v1/', 0, 'revision', '', 0),
(1044, 1, '2019-12-14 00:31:59', '2019-12-14 07:01:59', '<!-- wp:paragraph -->\n<p>\n\nWe\'d like to introduce a new friend to Froggies - please welcome Allegra! Allegra lives in Australia and is the daughter to one of our Directors here at ACAE. Allegra is joining us for the next two weeks. Allegra has settled in well to her new environment. She especially loves to play in the kitchen corner! Allegra wasn\'t shy introducing her self to her new classmates and had fun playing and dancing together with them. Thanks for playing and learning with us Allegra! We\'re looking forward to getting to know you better over the next couple of weeks.\n\n</p>\n<!-- /wp:paragraph -->', 'Introduce a new friend to Froggies', '', 'publish', 'closed', 'closed', '', 'introduce-a-new-friend-to-froggies', '', '', '2019-12-14 00:32:00', '2019-12-14 07:02:00', '', 0, 'http://acae.dd/?p=1044', 0, 'post', '', 0),
(1045, 1, '2019-12-14 00:31:59', '2019-12-14 07:01:59', '<!-- wp:paragraph -->\n<p>\n\nWe\'d like to introduce a new friend to Froggies - please welcome Allegra! Allegra lives in Australia and is the daughter to one of our Directors here at ACAE. Allegra is joining us for the next two weeks. Allegra has settled in well to her new environment. She especially loves to play in the kitchen corner! Allegra wasn\'t shy introducing her self to her new classmates and had fun playing and dancing together with them. Thanks for playing and learning with us Allegra! We\'re looking forward to getting to know you better over the next couple of weeks.\n\n</p>\n<!-- /wp:paragraph -->', 'Introduce a new friend to Froggies', '', 'inherit', 'closed', 'closed', '', '1044-revision-v1', '', '', '2019-12-14 00:31:59', '2019-12-14 07:01:59', '', 1044, 'http://acae.dd/1044-revision-v1/', 0, 'revision', '', 0),
(1046, 1, '2019-12-14 00:41:25', '2019-12-14 07:11:25', '<p>ကျနော်တို့ Froggies နဲ့သူငယ်ချင်းအသစ်ကိုမိတ်ဆက်ပေးချင်ပါတယ်။ Allegra ကိုကြိုဆိုပါတယ်။ Allegra သည်သြစတြေးလျတွင်နေထိုင်ပြီး ACAE ရှိကျွန်ုပ်တို့၏ဒါရိုက်တာတစ် ဦး ၏သမီးဖြစ်သည်။ Allegra သည်လာမည့်နှစ်ပတ်တွင်ကျွန်ုပ်တို့ကိုလာရောက်ပူးပေါင်းမည်။ Allegra သည်သူမ၏ပတ် ၀ န်းကျင်အသစ်နှင့်ကောင်းစွာနေခဲ့သည်။ သူမသည်မီးဖိုချောင်ထောင့်တွင်ကစားရန်အထူးသဖြင့်နှစ်သက်သည်။ Allegra သည်သူမ၏အတန်းဖော်အသစ်များနှင့်မိတ်ဆက်ရန်ရှက်ရွံ့ခြင်းမရှိဘဲသူတို့နှင့်အတူကစားခြင်း၊ ကျွန်ုပ်တို့နှင့် Allegra ကစားခြင်းနှင့်သင်ယူခြင်းအတွက်ကျေးဇူးတင်ပါသည်။ နောက်လာမည့်ရက်သတ္တပတ်အနည်းငယ်အတွင်းသင့်အားပိုမိုသိကျွမ်းလာရန်မျှော်လင့်ပါသည်။</p>', 'Allegra နှင့်မိတ်ဆက်ပေးခြင်း', '', 'inherit', 'closed', 'closed', '', '1040-revision-v1', '', '', '2019-12-14 00:41:25', '2019-12-14 07:11:25', '', 1040, 'http://acae.dd/1040-revision-v1/', 0, 'revision', '', 0),
